import React from 'react';

import './MenuBarStyle.css';
import { C_Icon } from '../Components';

function MenuBar() {
    return (
        <div className="leftMenuBar blur">

            <div className="homeIcon">
                <C_Icon icon="home" />
            </div>

            <div className="option">
                <C_Icon onClick={() => this.openClients()} icon="people" />
            </div>

        </div>
    )
}

export default MenuBar;
